import React from 'react';
import { Table } from 'antd';
import { data } from './data'

const dataSource = [
    {
        key: '1',
        name: 'Mike',
        age: 32,
        address: '10 Downing Street',
    },
    {
        key: '2',
        name: 'John',
        age: 42,
        address: '10 Downing Street',
    },
];

const columns = [
    {
        title: 'App Name',
        dataIndex: 'name',
        key: 'name',
    },
    {
        title: 'Age',
        dataIndex: 'age',
        key: 'age',
    },
    {
        title: 'Address',
        dataIndex: 'address',
        key: 'address',
    },
];

const App = () => {
    return <Table dataSource={dataSource} columns={columns} />;
};

export default App;


const MyComponent = () => {
    return(
        <div>
            {data.map((item) => (
                <div key={item.app_name}>
                    <h3>Name: {item.username}</h3>
                    <p>Age: {item.password}</p>
                </div>
            ))}
        </div>
    );
};
